
public class FiveTimes5StarsSameRowDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//4.print 5 stars,5 times in same row line
				for(int i=1;i<=5;i++)
				{
					for(int j=1;j<=5;j++)
					{
						System.out.print("*");
					}
				}
				System.out.println();
				

	}

}
